INSERT INTO `tbl_faqs` (`id`, `question`, `answer`, `status`, `order_no`, `created_at`, `updated_at`, `category`, `slug`, `author`) VALUES
(1, 'What perform credit and background checks', '<p>The Owner tab is comprised owners and contacts collected from public sources as well as data from our exclusive data partners. We have been able to pierce through shell LLCs and identify true owners to ensure you are granted the most accurate access to property ownership details.</p><p>You will see two sections on the owner tab -- Owners and Contacts. The Owner section includes the company and/or people owners that we have identified as being the owner of the property. Here, if applicable, you will be able to see if a property is owned directly or through a subsidiary, branch or shell company. We have also been able to identify and indicate if an owner is affiliated with a religious or government entity.</p><p>The Contacts section includes names, job titles, addresses, phone numbers and/or emails for individuals that are associated with the identified company owner.</p><p>We always include the Reported Owner information on this tab which is details derived from the tax assessor record as well as Mortgage Signatory information.</p><p>To learn more about everything the owner tab has to offer, check out the article, Get the most out of the new owner tab!</p>', 1, NULL, '2022-08-12 08:33:30', '2024-05-17 04:33:36', 1, 'what-perform-credit-and-background-checks-1', 'Diana Richards'),
(2, 'How we review maintenance requests', '<p>On all potential tenants through Loftus to maintain a peace of mind without the hassle. Loftus teams up with TransUnion to provide swift reports for a secure and informed decision.</p>', 1, NULL, '2022-08-12 08:37:09', '2024-05-17 04:33:48', 1, 'how-we-review-maintenance-requests-1', 'John Doe'),
(3, 'How I can listing property immediately', '<p>On all potential tenants through Loftus to maintain a peace of mind without the hassle. Loftus teams up with TransUnion to provide swift reports for a secure and informed decision.</p>', 1, NULL, '2022-08-12 08:41:24', '2024-05-17 04:34:02', 2, 'how-i-can-listing-property-immediately-1', 'Michael Nike'),
(4, 'FAQ Testing', '<p>faqs text block</p>', 1, NULL, '2022-08-19 08:18:45', '2024-05-17 04:34:12', 2, 'faq-testing-1', 'Steffan Salvator');
