INSERT INTO `tbl_multi_text` (`id`, `title`, `detail`, `txt1`, `txt2`, `txt3`, `txt4`, `txt5`, `image`, `section`, `order_no`, `created_at`, `updated_at`) VALUES
(3, 'Simplicity', 'Whether you are looking to rent an apartment or are a first-time home buyer, you must go through multiple systems and entities before you can finally move in. Loftus consolidates a variety of offerings into one simplified user-friendly platform to get you settled in faster. Our services are modularized; whether you are looking for a single offering or the complete bundle, our step-by-step workflow will guide you from start to finish.', '', '', '', '', '', NULL, 'mission-blocks', 1, NULL, NULL),
(4, 'Transparency', 'At any point during the home buying or renting process, you may incur unforeseen costs and hidden fees. Loftus emphasizes transparency in all our offerings. We aim to minimize and remove redundant and unnecessary fees. As a tenant or a buyer, you can gauge what the competition is offering and verify your offers are being presented and considered. As an owner, easily browse through your offers to select the most competitive one for your needs.', '', '', '', '', '', NULL, 'mission-blocks', 2, NULL, NULL),
(5, 'Collaboration', 'With its in-app messaging system, Loftus makes connecting directly with tenants, prospective buyers and sellers, and various third parties easy. No matter when and where you are, the real time responses help you stay engaged with interested parties. Plus, youâ€™ll be able to stay on top of it all with push notifications and alerts that can be tailored for your priorities.', '', '', '', '', '', NULL, 'mission-blocks', 3, NULL, NULL);
