INSERT INTO `tbl_sitecontent` (`id`, `ckey`, `code`, `full_code`, `site_lang`, `created_at`, `updated_at`) VALUES
(1, 'home', 'a:96:{s:10:\"page_title\";s:4:\"Home\";s:10:\"meta_title\";s:4:\"Home\";s:16:\"meta_description\";s:41:\"A Click Away From Finding Your Dream Home\";s:13:\"meta_keywords\";s:33:\"home, dream, property, liveloftus\";s:6:\"_token\";s:40:\"3QkgEMicnLMxzZyZ7ObYVPSmQ9qaBWySBmslxgf4\";s:14:\"banner_heading\";s:41:\"A Click Away From Finding Your Dream Home\";s:11:\"banner_text\";s:93:\"<h1>Hire <i>&amp; Explore</i></h1><p>Find all you need nearby â€“ for home, fun, or work!</p>\";s:13:\"banner_search\";s:29:\"Address, City, ZIP Code, â€¦.\";s:15:\"block_heading_2\";s:9:\"Advertise\";s:12:\"block_text_2\";s:61:\"Post a listing within minutes and customize it to your liking\";s:15:\"block_heading_3\";s:5:\"Offer\";s:12:\"block_text_3\";s:66:\"Negotiate offers until an agreement is reached amongst all parties\";s:15:\"block_heading_4\";s:6:\"Manage\";s:12:\"block_text_4\";s:89:\"Create leases, track payments, and handle maintenance requests for your rental properties\";s:15:\"block_heading_5\";s:7:\"Connect\";s:12:\"block_text_5\";s:90:\"Using our in-app messaging system, chat with landlords or simply engage with other tenants\";s:16:\"featured_heading\";s:19:\"Featured Properties\";s:18:\"featured_link_text\";s:19:\"View All Properties\";s:17:\"featured_link_url\";s:11:\"/properties\";s:11:\"how_heading\";s:12:\"How It Works\";s:14:\"how_video_text\";s:11:\"Watch Video\";s:19:\"how_block_heading_7\";s:14:\"Enter location\";s:16:\"how_block_text_7\";s:119:\"Itâ€™s the age-old question: are you a beach person or are you a mountain person? We have listings from coast to coast.\";s:19:\"how_block_heading_8\";s:13:\"Find property\";s:16:\"how_block_text_8\";s:108:\"Once youâ€™ve decided, browse through our growing inventory of homes to find the one thatâ€™s right for you.\";s:19:\"how_block_heading_9\";s:10:\"Make offer\";s:16:\"how_block_text_9\";s:68:\"Found the one you like? Glance through other offers and place yours.\";s:20:\"how_block_heading_10\";s:8:\"Take key\";s:17:\"how_block_text_10\";s:64:\"Hooray! Itâ€™s time to furniture shop, decorate, and cozy on in.\";s:15:\"grid_heading_11\";s:36:\"Perform credit and background checks\";s:12:\"grid_text_11\";s:180:\"On all potential tenants through Loftus to maintain a peace of mind without the hassle. Loftus teams up with TransUnion to provide swift reports for a secure and informed decision.\";s:15:\"grid_heading_12\";s:27:\"Review maintenance requests\";s:12:\"grid_text_12\";s:254:\"As a landlord by sorting through pending requests to assign and schedule maintenance personnel to complete each task. As a tenant, generate requests and track its status until completion. Once completed, tenants have the opportunity to rate each service.\";s:21:\"update_block1_heading\";s:19:\"Renting made simple\";s:18:\"update_block1_text\";s:124:\"From start to finish we will help you find your next tenant(s) or transition existing tenant(s) to keep it all in one place.\";s:23:\"update_block1_link_text\";s:9:\"Read More\";s:22:\"update_block1_link_url\";s:6:\"/about\";s:21:\"update_block2_heading\";s:23:\"Unique offer experience\";s:18:\"update_block2_text\";s:90:\"We believe in transparency, so we display all pending offers in their respective listings.\";s:23:\"update_block2_link_text\";s:9:\"Read More\";s:22:\"update_block2_link_url\";s:6:\"/about\";s:21:\"update_block3_heading\";s:16:\"Take us with you\";s:18:\"update_block3_text\";s:57:\"Download us on your mobile so youâ€™ll have us on the go!\";s:26:\"update_block3_grid_link_16\";s:1:\"?\";s:26:\"update_block3_grid_link_17\";s:1:\"?\";s:23:\"manage_property_heading\";s:41:\"The perfect place to manage your property\";s:32:\"manage_property_block_heading_18\";s:21:\"Advertise your rental\";s:29:\"manage_property_block_text_18\";s:76:\"Find your ideal tenant by listing your property in just a few, simple steps.\";s:32:\"manage_property_block_heading_19\";s:17:\"Lease 100% online\";s:29:\"manage_property_block_text_19\";s:83:\"Execute your lease with your tenant(s), accept payments, store documents, and more.\";s:32:\"manage_property_block_heading_20\";s:29:\"Property management resources\";s:29:\"manage_property_block_text_20\";s:131:\"Track maintenance requests, perform credit and background checks, chat with your tenants, and track payments all in one simple app.\";s:17:\"locations_heading\";s:32:\"Locations we think you will love\";s:19:\"top_markets_heading\";s:11:\"TOP MARKETS\";s:6:\"image1\";s:44:\"keuVABraAOnZ45dNsOJgz3yC64X33nLaRcjUziiT.svg\";s:6:\"image2\";s:44:\"aWWYPdkt90JMEEoKzcNsLyJfgpy4PcxTtMRzcIg0.svg\";s:6:\"image3\";s:44:\"yB63KGqrZwpZx1PaZePjGzUfwwdn6BVrk694wWY6.svg\";s:6:\"image4\";s:44:\"KL3vJMftfWENXM7pitJZIBiGmgtGDAv87Wl3ijJ5.svg\";s:6:\"image5\";s:44:\"V1H9grtKGhTtZlgZD1k8Yy6jjrMkjjGDjrdzGHu0.svg\";s:6:\"image7\";s:44:\"Ip03dXJVWPkgtXAmVZGUC46KQ3af6GavTRXSPuHH.png\";s:6:\"image8\";s:44:\"DzkSCRNixeqSqFUbgtJWlAHqUQtTnDZJRXyypmWO.png\";s:6:\"image9\";s:44:\"S3TNXmwfWpgUzPw6qq2YpSVI7lWYUWHZ0QwwRNuy.png\";s:7:\"image10\";s:44:\"GS78sOHrb7Ey2tOzDP6yNC8i4iCyvR5S6lx4iRdN.png\";s:6:\"image6\";s:44:\"QanPtw87OErLVe1eJx8lhrSmmd0PZxYTEvpPvuPa.svg\";s:7:\"image11\";s:44:\"VDCtP1bLR7hTFwTsvhvM7NkCr7zW6OtQccwPSOnK.jpg\";s:7:\"image12\";s:44:\"dR2ZeusCoLqS5aRfgdPrdggIIWyn0UfsfAlh5glg.jpg\";s:7:\"image13\";s:44:\"DS0PUHvabX2Fz6ijyxuWzVDvs2KFZ0cqVwD31eww.jpg\";s:7:\"image14\";s:44:\"Fo0lYzSfJplvTFtzcNzIotu1RtHCzEl71AosJOyj.jpg\";s:7:\"image15\";s:44:\"ravc1KNM07r6jUuQxJRLtG3ZrdIHDthc9bXgLU1u.jpg\";s:7:\"image16\";s:44:\"bfDGEiN01RA8EZvmdPtbQferUcX1Dctm6kb27fim.png\";s:7:\"image17\";s:44:\"ouheNb0Q0MPkuQ3RATydf8leQB093H6u4p5wggFw.png\";s:7:\"image18\";s:44:\"VsV0LgpuIYF7mlPKfWP3Vxyz1DULuf6dEvcgGxse.jpg\";s:7:\"image19\";s:44:\"4tqxKnuj6FbE1btEpJ6jucJqgBltaeCsDXu7CRxK.jpg\";s:7:\"image20\";s:44:\"Yjs5Ct3YzEJh3ycc1PMrAZNNTEDO8grO03bAlp4N.jpg\";s:6:\"video1\";s:44:\"dc8A99OhR7Syc93N2z4Ye4A8nv7dDS9ACfg70JBv.mp4\";s:14:\"update_heading\";s:66:\"We constantly update our listings, so youâ€™re alwa