(6, 'blog', 'a:17:{s:6:\"_token\";s:40:\"xYIFkjsnuPsgaU8NklpqNvSwyjg9QP5P4dwxT3R4\";s:10:\"page_title\";s:4:\"Blog\";s:10:\"meta_title\";s:4:\"Blog\";s:16:\"meta_description\";s:13:\"Blog Articles\";s:13:\"meta_keywords\";s:19:\"blog, article, news\";s:17:\"category_heading1\";s:10:\"Categories\";s:17:\"category_heading2\";s:18:\"Most Popular Posts\";s:17:\"category_heading3\";s:12:\"Popular Tags\";s:11:\"banner_text\";s:274:\"<h1>Discover Nice <i>Articles</i> Here</h1><p>Welcome to our blog dedicated to unraveling the marvels of sustainable living! In a world where environmental concerns are becoming increasingly pressing, adopting sustainable practices isn\'t just a choice; it\'s a necessity.</p>\";s:13:\"section6_text\";s:240:\"<h2>Start Renting Today</h2><p>Ready to experience the convenience and savings of renting? Browse our catalog now and find everything you need for home, work, or play. Join our growing community of renters and make the smart choice with</p>\";s:14:\"sec3_heading13\";s:11:\"Download on\";s:11:\"sec3_text13\";s:9:\"App Store\";s:14:\"sec3_heading14\";s:9:\"Get it on\";s:11:\"sec3_text14\";s:11:\"Google Play\";s:7:\"image12\";s:44:\"OADsNA6PQd0qp0f4OuDxwIRGTWRvKb75ONfcqAHx.svg\";s:7:\"image13\";s:44:\"1htbBvoOLCLqAxN1UFajsRXQLW8v2vZc4LtCNuIC.png\";s:7:\"image14\";s:44:\"MhZ3TGsvlY3EGeKtNt75AXl1AxGL0zu2wTLXI8Dv.png\";}', NULL, NULL, '2022-08-11 08:42:04', '2024-05-17 11:45:38'),
(7, 'about', 'a:71:{s:6:\"_token\";s:40:\"eW8pYTR0U5KSG2nQ9On54D9Dbiowbts18zAfCKNl\";s:10:\"page_title\";s:8:\"About Us\";s:10:\"meta_title\";s:8:\"About Us\";s:16:\"meta_description\";s:120:\"we are passionate about revolutionizing the way people access and enjoy the items they need for home, work, and leisure.\";s:13:\"meta_keywords\";s:40:\"about, us,people, access, leisure, dream\";s:14:\"banner_heading\";s:33:\"Transforming Real Estate Together\";s:11:\"banner_text\";s:311:\"<h1><i>About</i> Us</h1><p>we are passionate about revolutionizing the way people access and enjoy the items they need for home, work, and leisure.</p><p>Our platform is dedicated to providing a seamless and convenient rental experience, offering a diverse range of high-quality products for every occasion.</p>\";s:16:\"banner_link_text\";s:8:\"Services\";s:15:\"banner_link_url\";s:9:\"/services\";s:17:\"banner_link1_text\";s:4:\"FAQs\";s:16:\"banner_link1_url\";s:4:\"/faq\";s:11:\"why_heading\";s:7:\"Why us?\";s:19:\"why_block_heading_2\";s:9:\"Liquidity\";s:16:\"why_block_text_2\";s:132:\"Through our innovative services, not only do we bring simplicity and transparency, but we also endorse a more robust market dynamic.\";s:19:\"why_block_heading_3\";s:9:\"Stability\";s:16:\"why_block_text_3\";s:106:\"Our solutions help promote market equilibrium to ensure our users are satisfied in their customer journey.\";s:19:\"why_block_heading_4\";s:9:\"Ingenuity\";s:16:\"why_block_text_4\";s:109:\"We are avidly developing cutting edge solutions to add on to our services to enhance the customer experience.\";s:12:\"user_heading\";s:22:\"Growing with our users\";s:9:\"user_text\";s:446:\"<h2>Growing with our users</h2>\r\n\r\n<p>As a startup, each and every user is valued dearly. Regardless of whether you joined at the beginning or later on in our journey, we are so thankful for your support and are committed to our users, first and foremost. As we face challenges on the road ahead, Loftus wants every voice to be heard and will take them into account to improve and ensure our platform continues to suit the needs of our users.</p>\";s:10:\"user_text1\";s:299:\"<h3>Our Misson</h3>\r\n\r\n<p>Loftus is on a mission to transform real estate through simplicity, transparency, and collaboration.</p>\r\n\r\n<h3>Our Vision</h3>\r\n\r\n<p>Empower every user to succeed&mdash;no matter how experienced&mdash;by providing a cost-effective, streamlined, and autonomous solution</p>\";s:14:\"user_link_text\";s:9:\"Read More\";s:13:\"user_link_url\";s:6:\"/about\";s:20:\"user_block_heading_6\";s:3:\"300\";s:17:\"user_block_text_6\";s:5:\"Users\";s:20:\"user_block_heading_7\";s:3:\"400\";s:17:\"user_block_text_7\";s:8:\"Listings\";s:20:\"user_block_heading_8\";s:3:\"250\";s:17:\"user_block_text_8\";s:6:\"Cities\";s:20:\"user_block_heading_9\";s:3:\"200\";s:17:\"user_block_text_9\";s:8:\"Partners\";s:14:\"review_heading\";s:24:\"What people say about us\";s:16:\"partners_heading\";s:12:\"Our partners\";s:6:\"image1\";s:44:\"G55lzW2BuvzgolvUceJs91n20wqYtDYjjvJarwug.svg\";s:6:\"image2\";s:44:\"mLCOj0gs7FL0xBSKIzAbHK2cwFqTVq7NUhQaFEk7.svg\";s:6:\"image3\";s:44:\"CfclewkTBxeIubIXtJBU8t1RfEHp8DEorXqT9jOm.svg\";s:6:\"image4\";s:44:\"RYvfdwuJUrXbEH6ZS3f84vrPW2CCmlXQ6jibR6FR.svg\";s:6:\"image5\";s:44:\"noMe3XiNyJSdPaowueHgZpUE5b8jKFBNHjxH18du.svg\";s:6:\"image6\";s:44:\"a2RuDGAvpT12VdxlWjdRt26AIc72G2HWzkAGoX77.svg\";s:6:\"image7\";s:44:\"R7aP7LFpnCxdQMRtZHGA70y3B0jfM5ViKKFVDTzE.svg\";s:6:\"image8\";s:44:\"YV5hH6PoEFldbqyUFXgkGpv8k3vU4Qk2NdyrNSpX.svg\";s:6:\"image9\";s:44:\"QS3e4gDqRpdoUeEyZO7YrXeZS0nDrOxJda5nxSQ5.svg\";s:7:\"image10\";s:0:\"\";s:16:\"section1_heading\";s:11:\"Our Mission\";s:13:\"section1_text\";s:398:\"<p>At the heart of our mission is the belief that access to the items you need should be easy, affordable, and sustainable. We strive to empower individuals and communities by offering a more flexible and economical alternative to traditional ownership. By promoting the sharing economy, we aim to reduce waste, promote resourcefulness, and foster a stronger sense of community among our users.</p>\";s:13:\"section2_text\";s:29:\"<h2>Why <i>Choose</i> Us</h2>\";s:13:\"sec3_heading2\";s:17:\"Diverse Selection\";s:10:\"sec3_text2\";s:132:\"From home essentials to outdoor gear and work tools, we offer a wide range of rental products to cater to every need and preference.\";s:13:\"sec3_heading3\";s:17:\"Quality Assurance\";s:10:\"sec3_text3\";s:135:\"We partner with trusted suppliers and conduct rigorous quality checks to ensure that every item meets our high standards of excellence.\";s:13:\"sec3_heading4\";s:11:\"Convenience\";s:10:\"sec3_text4\";s:130:\"With user-friendly browsing, flexible rental options, and convenient pickup and drop-off locations, renting has never been easier.\";s:13:\"sec3_heading5\";s:13:\"Affordability\";s:10:\"sec3_text5\";s:122:\"Say goodbye to hefty upfront costs and ongoing maintenance expenses. Our competitive rental rates make luxury to everyone.\";s:13:\"section3_text\";s:305:\"<h2>Our <i>Story</i></h2><p>Rentato was founded with a simple yet powerful idea: to make renting accessible, affordable, and enjoyable for everyone. What started as a passion project has since evolved into a thriving platform that connects thousands of users with the items they need on a daily basis.</p>\";s:13:\"section4_text\";s:35:\"<h2>Helping you <i>Saveâ€¦</i></h2>\";s:13:\"sec3_heading7\";s:5:\"Space\";s:10:\"sec3_text7\";s:45:\"No need to horde items you barely use anymore\";s:13:\"sec3_heading8\";s:5:\"Money\";s:10:\"sec3_text8\";s:54:\"Helping create a side income to fund future endeavours\";s:13:\"sec3_heading9\";s:15:\"The Environment\";s:10:\"sec3_text9\";s:62:\"Reduce your environmental footprint and promote sustainability\";s:13:\"section6_text\";s:32:\"<h2>Download Our <i>App</i></h2>\";s:14:\"sec3_heading13\";s:11:\"Download on\";s:11:\"sec3_text13\";s:9:\"App Store\";s:14:\"sec3_heading14\";s:9:\"Get it on\";s:11:\"se