(15, 'how_it_works', 'a:46:{s:6:\"_token\";s:40:\"xYIFkjsnuPsgaU8NklpqNvSwyjg9QP5P4dwxT3R4\";s:10:\"page_title\";s:12:\"How it works\";s:10:\"meta_title\";s:12:\"How it works\";s:16:\"meta_description\";s:22:\"How To Rent On Rentaro\";s:13:\"meta_keywords\";s:12:\"Rent,Rentaro\";s:11:\"banner_text\";s:332:\"<h1>How To <i>Rent</i> On <i>Rentaro</i></h1><p>we are passionate about revolutionizing the way people access and enjoy the items they need for home, work, and leisure.</p><p>Our platform is dedicated to providing a seamless and convenient rental experience, offering a diverse range of high-quality products for every occasion.</p>\";s:17:\"section1_heading1\";s:28:\"<h2>How It <i>Works</i></h2>\";s:17:\"section1_heading2\";s:10:\"For Buyers\";s:13:\"sec3_heading2\";s:6:\"Browse\";s:10:\"sec3_text2\";s:313:\"Explore our extensive catalog of rental products conveniently categorized for easy browsing. Use our search filters to narrow down your options by category, price, location, and more. Whether you\'re looking for home essentials, outdoor gear, or work tools, finding the perfect rental item is quick and effortless.\";s:13:\"sec3_heading3\";s:4:\"Rent\";s:10:\"sec3_text3\";s:290:\"Once you\'ve found the item you need, select your desired rental period and proceed to checkout. We offer flexible rental durations to suit your schedule, whether you need an item for a day, a week, or longer. Review your order details and complete the rental process with just a few clicks.\";s:13:\"sec3_heading4\";s:5:\"Enjoy\";s:10:\"sec3_text4\";s:305:\"Once your rental request is confirmed, it\'s time to enjoy your chosen items to the fullest! Whether you\'re furnishing your home, embarking on an outdoor adventure, or tackling a DIY project, make the most out of your rental experience knowing that you\'re getting high-quality products at affordable rates.\";s:13:\"section5_text\";s:29:\"<h2>Why <i>Choose</i> Us</h2>\";s:13:\"sec3_heading8\";s:17:\"Diverse Selection\";s:10:\"sec3_text8\";s:132:\"From home essentials to outdoor gear and work tools, we offer a wide range of rental products to cater to every need and preference.\";s:13:\"sec3_heading9\";s:17:\"Quality Assurance\";s:10:\"sec3_text9\";s:135:\"We partner with trusted suppliers and conduct rigorous quality checks to ensure that every item meets our high standards of excellence.\";s:14:\"sec3_heading10\";s:11:\"Convenience\";s:11:\"sec3_text10\";s:130:\"With user-friendly browsing, flexible rental options, and convenient pickup and drop-off locations, renting has never been easier.\";s:14:\"sec3_heading11\";s:13:\"Affordability\";s:11:\"sec3_text11\";s:122:\"Say goodbye to hefty upfront costs and ongoing maintenance expenses. Our competitive rental rates make luxury to everyone.\";s:13:\"section6_text\";s:240:\"<h2>Start Renting Today</h2><p>Ready to experience the convenience and savings of renting? Browse our catalog now and find everything you need for home, work, or play. Join our growing community of renters and make the smart choice with</p>\";s:14:\"sec3_heading13\";s:11:\"Download on\";s:11:\"sec3_text13\";s:9:\"App Store\";s:14:\"sec3_heading14\";s:9:\"Get it on\";s:11:\"sec3_text14\";s:11:\"Google Play\";s:6:\"image1\";s:44:\"FGihlg2JSKqjcPHxUtkx2Hh3KayqvqmPo4jiQgGx.svg\";s:6:\"image2\";s:44:\"9yb8w4UjUWtbYStlqjR3vVFIAZTky7zfk4aJR81T.svg\";s:6:\"image3\";s:44:\"WGMGymITqQ7nKGAkOYPxsBeqoChNQX9L1ueg29hu.svg\";s:6:\"image4\";s:44:\"OPFpJQKGBH8KwUVxxRPy2OsvmYOoq54L4UgIuGDq.svg\";s:13:\"section2_text\";s:20:\"<h3>For Sellers</h3>\";s:6:\"image5\";s:44:\"dXBoJ4DoSznuEkerNj0raiL4PqBfbRe1HLAf51NH.svg\";s:6:\"image6\";s:44:\"tDE0z3KhhRfCsW4WpdRMEGatKyWy54fHN6GkGRo9.svg\";s:6:\"image7\";s:44:\"ST4Mm65UcywBqsCT9MHhtHznWfEfqsDlv8jvg8Lk.svg\";s:6:\"image8\";s:44:\"1xH2Ux7L0q1Dv0EsKOWF7djNDVEEbvaxCQy5Hctz.svg\";s:6:\"image9\";s:44:\"13s7eRxhpJkSVmTNTGS9B1tLDPIgwvWsX8bQJKgz.svg\";s:7:\"image10\";s:44:\"i6hjQBaVfv0xM6B1Fm4NexDVVnp9O8n3jlKEIZhj.svg\";s:7:\"image11\";s:44:\"dBL2uwwm2j3wqP4EHkdDoqPTOyPi6pYosX1PVLSi.svg\";s:7:\"image12\";s:44:\"bbeULPKtliJtxroToqVzvRftMQibFAfmAlTVQFkC.svg\";s:7:\"image13\";s:44:\"a6WxLYmMkPrWmOdAE04RblwoKSXtKXItu2JYej65.png\";s:7:\"image14\";s:44:\"6hN6ixHH4FFvjOuKuvHKcEbstVcagLr6h2kYVvtf.png\";s:13:\"section_text5\";s:229:\"<h5>List Your Items</h5><p>Got items to spare? List them on our platform to start earning extra income! Simply create a seller account, upload photos and descriptions of your items, and set your rental rates and availability.</p>\";s:13:\"section_text6\";s:275:\"<h5>Receive Rental Requests</h5><p>Once your items are listed, sit back and relax as rental requests start rolling in. You\'ll receive notifications whenever a user is interested in renting your items, allowing you to accept or decline requests based on your availability.</p>\";s:13:\"section_text7\";s:227:\"<h5>Get Paid</h5><p>Once the rental period is over and the items are returned in good condition, you\'ll receive payment for the rental fees directly to your account. It\'s that easy to turn your unused items into extra cash!</p>\";}', NULL, NULL, '2024-05-15 09:17:38', '2024-05-17 10:31:36'),
(16, 'help', 'a:14:{s:6:\"_token\";s:40:\"eW8pYTR0U5KSG2nQ9On54D9Dbiowbts18zAfCKNl\";s:10:\"page_title\";s:4:\"Help\";s:10:\"meta_title\";s:4:\"Help\";s:16:\"meta_description\";s:16:\"How can we help?\";s:13:\"meta_keywords\";s:12:\"help, rentro\";s:11:\"banner_text\";s:25:\"<h1>How can we help?</h1>\";s:13:\"section6_text\";s:240:\"<h2>Start Renting Today</h2><p>Ready to experience the convenience and savings of renting? Browse our catalog now and find everything you need for home, work, or play. Join our growing community of renters and make the smart choice with</p>\";s:14:\"sec3_heading13\";s:11:\"Download on\";s:11:\"sec3_text13\";s:9:\"App Store\";s:14:\"sec3_heading14\";s:9:\"Get it on\";s:11:\"sec3_text14\";s:11:\"Google Play\";s:7:\"image12\";s:44:\"lnq3DoWYF1r2Bb5Pb7vKgRAkHHkTapjo46x3O4ap.svg\";s:7:\"image13\";s:44:\"FSE77y2stsg43MLgBKK0gh0DnVnf3W8LiDYjIyl6.png\";s:7:\"image14\";s:44:\"oOdEZnrkpKaQLOJUE94wazR232Yk8og5jfcojeqz.png\";}', NULL, NULL, '2024-05-16 10:42:54', '2024-05-16 10:45:09');
